        //                 </a>

        //             </div>
        //         </div>
        //     </div>
        // </div>
        <div id="signup" >
            <div id="blur" style={{ width: "350px", height: "500px", marginTop: "75px", marginLeft: "560px", borderRadius: "15px", padding: "5px" }}>

                <form >
                    <h2 style={{ textAlign: "center" }} >SignUp</h2>
                    <div>
                        <label  ><b style={{ fontSize: "larger" }}>Name:</b></label>
